+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="1C2A3DF64DDA78192E53D988BBBF2687", NativeString="Give a like to this island to support its creator! There is no limit on islands you can like.", LocalizedStrings=(("ar","قم بتوصية هذه الجزيرة لدعم مُبدِعها! لا توجد قيود لعدد الجُزر التي بإمكانك توصيتها"),("en","Recommend this island to support its creator! There is no limit on islands you can recommend"),("de","Empfehle diese Insel weiter, um ihren Creator zu unterstützen! Du kannst so viele Inseln weiterempfehlen, wie du möchtest."),("es","¡Recomienda esta isla para apoyar a su creador! No hay un límite en las islas que puedes recomendar."),("es-419","¡Recomienda esta isla para apoyar a su creador! No hay un límite en las islas que puedes recomendar."),("fr","Recommandez cette île pour soutenir son créateur ! Vous pouvez recommander autant d'îles que vous voulez."),("it","Consiglia quest'isola per supportare il suo creatore! Puoi consigliare tutte le isole che vuoi."),("ja","この島を「おすすめ」してクリエイターをサポートしましょう！ おすすめできる島の数に上限はありません。"),("ko","이 섬을 추천하고 크리에이터를 후원하세요! 추천할 수 있는 섬에는 제한이 없습니다."),("pl","Poleć tę wyspę, aby wesprzeć jej twórcę! Nie ma limitu wysp, które możesz polecić."),("pt-BR","Recomende esta Ilha para apoiar quem a criou! Não há limites de quantas Ilhas você pode recomendar."),("ru","Рекомендуйте остров, поддержите автора! Число рекомендаций не ограниченно"),("tr","БОЛЬШЕ НЕ НРАВИТСЯ?"),("zh-hans","推荐该岛屿以支持创作者！岛屿推荐数量无上限。")))
