+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="23AC4EFB46CACD9C5C68CCA41CC86D4B", NativeString="Stage 1 of 5 - Earn XP with an eligible friend in Battle Royale, Zero Build, Reload, Team Rumble, Save the World, or any creator-made experience except those made using UEFN.", LocalizedStrings=(("ar","المرحلة 1 من 5 - اكتسب خبرة مع صديق مؤهل في باتل رويال ووضع بلا بناء والإعادة والعودة ودمدمة الفريق وأنقِذ العالم أو أي تجربة من ابتكار المبدعين باستثناء تلك المبتكرة باستخدام UEFN."),("en","Stage 1 of 5 - Earn XP with an eligible friend in Battle Royale, Zero Build, Reload, OG, Team Rumble, Save the World, or any creator-made experience except those made using UEFN."),("de","Phase 1 von 5 – Verdiene EP mit einem berechtigten Freund in den Modi Battle Royale, Null Bauen, Reload, OG, Gruppenkeile, Rette die Welt oder in von Creators erstellten Erlebnissen (außer solchen, die in UEFN erstellt wurden)."),("es","Fase 1 de 5: Consigue PE con un amigo que cumpla los requisitos en Battle Royale, Cero construcción, Recarga, Orígenes, Refriega de equipos, Salvar el mundo o cualquier experiencia de creadores que no esté hecha con Unreal Editor para Fortnite."),("es-419","Etapa 1 de 5: consigue PE con un amigo que cumpla con los requisitos en Batalla campal, Cero construcción, Fortnite: Recarga, Fornite OG, Combate de equipos, Salva el mundo o cualquier experiencia creada por creadores que no se haya creado con UEFN."),("fr","Étape 1 sur 5 - Gagner de l'EXP avec un ami éligible dans Battle Royale, Zéro construction, Recharge, OG, Foire d'empoigne, Sauver le monde, ou toute autre île de créateur, sauf celles créées dans l'UEFN"),("it","Fase 1 di 5 - Ottieni PE con un amico idoneo in Battaglia reale, Zero costruzioni, Rientro, Rissa a squadre, Salva il mondo e in qualunque esperienza realizzata dai creatori, a esclusione di quelle create con UEFN."),("ja","ステージ 1/5 - バトルロイヤル、ゼロビルド、リロード、ORIGIN、チームランブル、世界を救え、または任意のクリエイター制作のコンテンツ(UEFNで制作されたものを除く)で対象のフレンドとXPを獲得する"),("ko","1/5단계 - UEFN 창작 경험을 제외한 크리에이터 창작 경험 및 배틀로얄, 빌드 제로, 리로드, OG, 팀 럼블, 세이브 더 월드에서 자격 조건을 갖춘 친구와 XP 획득"),("pl","Etap 1 z 5 – Zdobądź PD z kwalifikującym się znajomym w Battle Royale, Zero Budowania, Reaktywacji, OG, Naparzance, Ratowaniu Świata lub dowolnych przygodach autorstwa Twórców oprócz przygód stworzonych w UEFN"),("pt-BR","Estágio 1 de 5 — Ganhe EXP com amizades aptas no Battle Royale, Trocação, Reload, Raiz, Equipe Tumulto, Salve o Mundo ou em experiências feitas por criadores (exceto UEFN)."),("ru","Этап 1 из 5: получите опыт с подходящим другом в «Королевской битве», «Нулевой высоте», «Перезарядке», «Как раньше», «Командной потасовке», «Сражении с Бурей» или на любых авторских островах, кроме тех, что созданы в UEFN."),("tr","Aşama 1/5 - Uygun bir arkadaşınla Battle Royale, Sıfır İnşa, Yeniden, Mazi, Kapışma Takımı, Dünyayı Kurtar'da veya UEFN kullanılarak yapılanlar hariç olmak üzere içerik üreticisi eseri deneyimlerde TP kazan."),("zh-hans","第1阶段（共5阶段） - 在Battle Royale、零建造、火力全开、怀旧、团队激战、守护家园或其创作者创作的任何体验中（使用 UEFN (Unreal Editor Fortnite 特别版) 创作的体验除外），与符合条件的好友一同赚取经验值。")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="A1DC51914730800ADBECD79A26E6D84A", NativeString="Stage 1 of 5 - Earn XP with a friend in Battle Royale, Zero Build, Reload, Team Rumble, Save the World, or any creator-made experience except those made using UEFN.", LocalizedStrings=(("ar","المرحلة 1 من 5 - اكتسب خبرة مع صديق مؤهل في باتل رويال ووضع بلا بناء والإعادة والعودة ودمدمة الفريق وأنقِذ العالم أو أي تجربة من ابتكار المبدعين باستثناء تلك المبتكرة باستخدام UEFN."),("en","Stage 1 of 5 - Earn XP with a friend in Battle Royale, Zero Build, Reload, OG, Team Rumble, Save the World, or any creator-made experience except those made using UEFN."),("de","Phase 1 von 5 – Verdiene EP mit einem berechtigten Freund in den Modi Battle Royale, Null Bauen, Reload, OG, Gruppenkeile, Rette die Welt oder in von Creators erstellten Erlebnissen (außer solchen, die in UEFN erstellt wurden)."),("es","Fase 1 de 5: Consigue PE con un amigo que cumpla los requisitos en Battle Royale, Cero construcción, Recarga, Orígenes, Refriega de equipos, Salvar el mundo o cualquier experiencia de creadores que no esté hecha con Unreal Editor para Fortnite."),("es-419","Etapa 1 de 5: consigue PE con un amigo que cumpla con los requisitos en Batalla campal, Cero construcción, Fortnite: Recarga, Fornite OG, Combate de equipos, Salva el mundo o cualquier experiencia creada por creadores que no se haya creado con UEFN."),("fr","Étape 1 sur 5 - Gagner de l'EXP avec un ami éligible dans Battle Royale, Zéro construction, Recharge, OG, Foire d'empoigne, Sauver le monde, ou toute autre île de créateur, sauf celles créées dans l'UEFN"),("it","Fase 1 di 5 - Ottieni PE con un amico idoneo in Battaglia reale, Zero costruzioni, Rientro, Rissa a squadre, Salva il mondo e in qualunque esperienza realizzata dai creatori, a esclusione di quelle create con UEFN."),("ja","ステージ 1/5 - バトルロイヤル、ゼロビルド、リロード、ORIGIN、チームランブル、世界を救え、または任意のクリエイター制作のコンテンツ(UEFNで制作されたものを除く)で対象のフレンドとXPを獲得する"),("ko","1/5단계 - UE