+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="07DD2C224ED03D14C053539F4F1593CC", NativeString="Brick Bay is a peaceful place primed for schemes, cons, and, I’m told, "fun with friends". We’re all on the same team, so try not to partake in any mischief I wouldn’t do.", LocalizedStrings=(("es","Litoral Ladrillo es un sitio pacífico preparado para argucias, timos y, según me han comentado, "diversión con colegas". Estamos todos en el mismo equipo, así que procura no hacer travesuras que yo no haría."),("es-419","Litoral Ladrillo es un lugar tranquilo propicio para planear, estafar y, según me dijeron, "divertirse con las amistades". Estamos en el mismo equipo, así que no hagas travesuras que no haría yo."),("ru","Город кубиков — тихое место, идеально подходящее для всяких проделок и «веселья с друзьями», как мне говорили. Все мы одна команда, так что постарайся не делать пакости, которые пришлись бы мне не по душе.")))
