+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="1CDC05104919C2204A25A0BF90CD932E", NativeString="Welcome to the party! In Brick Bay we’re all on the same team, the vibes are super chill, and everyone dances to their own beat. I love to jam on the beach, but you do you! TTYL <3", LocalizedStrings=(("es","¡Te damos la bienvenida a la fiesta! En Litoral Ladrillo estamos todos en el mismo equipo, hay superbuén rollo y la gente va a su bola. A mí me encanta improvisar en la playa, pero para gustos, los colores. ¡Hablamos luego! <3"),("es-419","¡Te damos la bienvenida a la fiesta! En Litoral Ladrillo todos estamos en el mismo equipo, el ambiente es superrelajado y cada uno va a su ritmo. ¡Me encanta improvisar en la playa, pero tú haz lo que quieras! Hablamos después <3"),("ru","Добро пожаловать на вечеринку! В Городе кубиков мы все одна команда. Здесь очень спокойно, и все живут в своём ритме. Я люблю играть музыку на пляже, но выбор за тобой! Поговорим позже <3")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="3D1F501141108B190963C9ABDD3FDB29", NativeString="Hiya! (｡◕‿‿◕｡) Welcome to Brick Bay, a city where everyone's on the same team! There's all sorts of colorful characters runnin' around – and probably no vampires?! Stop by Bobom Milk Tea and say hi!!", LocalizedStrings=(("es","¡Buenas! (｡◕‿‿◕｡) Te doy la bienvenida a Litoral Ladrillo, ¡una ciudad en la que todo el mundo está en el mismo equipo! Hay todo tipo de personajes variopintos y... creo que ningún vampiro. ¡Pásate a saludar por Deleitaté!"),("es-419","¡Hola! (｡◕‿‿◕｡) Te doy la bienvenida a Litoral Ladrillo, ¡una ciudad donde todos estamos en el mismo equipo! Hay todo tipo de personajes coloridos andando por ahí, y probablemente no haya vampiros. Visita Deleitaté y conoce a los demás."),("ru",""Приветик! (｡◕‿‿◕｡) Добро пожаловать в Город кубиков. Здесь все одна команда! Вокруг столько ярких персонажей•— и ни одного вампира?! Зайдите в «Бомбический чай»!")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="EF60476C48B6F472CABC2D9512D50E10", NativeString="Welcome to Brick Bay! We’re all on the same team, so the only beef you’ll find is at my restaurant. Don’t forget to work up an appetite!", LocalizedStrings=(("es","¡Te damos la bienvenida a Litoral Ladrillo! Aquí estamos todos en el mismo equipo, así que espero que pongas toda la carne en el asador para mantener el respeto. ¡No te olvides de venir con hambre!"),("es-419","¡Te doy la bienvenida a Litoral Ladrillo! Todos estamos en el mismo equipo, así que la única queja que tendrás será "¿por qué no hay más carne?". ¡No olvides tener hambre!"),("ru","Добро пожаловать в Город кубиков! Мы все в одной команде, так что свинью тебе подложат разве что в виде мяса в моём ресторане. Не забудь нагулять аппетит!")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="727D8E0648EA5CD9B5436E9403278A98", NativeString="This is Brick Bay, a city full of fun, friends, and great vibes. It’s like we’re all on the same team! Figure out what you’re interested in, and make this place your own!", LocalizedStrings=(("es","Esto es Litoral Ladrillo, una ciudad repleta de diversión, amistad y buenas vibras. ¡Es como si estuviésemos todos en el mismo equipo! Descubre qué cosas te interesan y siéntete como en casa."),("es-419","¡Llegaste a Litoral Ladrillo, una ciudad llena de diversión, amistades y buenas vibras! ¡Es como si todos estuviéramos en el mismo equipo! ¡Descubre qué te podría interesar y haz tuyo este lugar!"),("ru","Это Город кубиков — место для веселья, дружбы и отличного настроения. Похоже, мы все в одной команде! Найдите то, что вам интересно, и сделайте это место своим!")))
