+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="1D9407A8433562B48F180E84F88442C1", NativeString="Decide who you can text chat with and whether text reporting is Always On or Off When Possible.\r\n\r\nText reporting is Always On for players under the age of 18. The text reporting status is shown in the text input field before typing a message.\r\n\r\nQuickly report a conversation by pressing the Report Button while text chat is open.", LocalizedStrings=(("fr","Décidez avec qui vous pouvez discuter par écrit et si le signalement textuel est toujours activé ou désactivé si possible. Le signalement textuel est toujours activé pour les joueurs mineurs. Le paramètre actuel est indiqué dans le champ de texte avant de taper un message.\r\nSignalez une conversation en sélectionnant Signaler pendant que la fenêtre de discussion textuelle est ouverte.")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="406961974C9CDC891B4ED98D3B2D5906", NativeString="TBD", LocalizedStrings=(("ar","عند استخدام رقصة معجب اللاما #1 أثناء ارتداء زيّ ليونيل ميسي أو ميسي شرارة الزيّ الشبابي، فإنها ستقول \"ميسي\". أما عند ارتداء أي زيّ آخر، فإنها ستصدر صوت مأمأة."),("en","The #1 Fan Llama Emote will only play \"Messi\" when used while wearing either the Lionel Messi or Streetwear Spark Messi Outfit, and plays \"Baaa\" when wearing any other Outfit."),("de","Das Emote #1 Fan Llama spielt nur \„Messi\", wenn du das Lionel Messi oder Streetwear Spark Messi Outfit trägst, und \„Baaa\", wenn du ein anderes Outfit trägst."),("es","El gesto Llama del campeón reproducirá \"Messi\" únicamente cuando se utilice con el traje de Lionel Messi o el traje Messi casual electrificante, y reproducirá \"Baaa\" al usarse con cualquier otro traje."),("es-419","El Gesto Llama superfán solo dirá \"Messi\" cuando se use con los atuendos Lionel Messi o Messi casual electrificante, y \"Baaa\" con cualquier otro atuendo."),("fr","L'emote Lama fan numéro 1 jouera « Mais non ? Messi ! » uniquement lorsque vous porterez la tenue Lionel Messi ou la tenue Streetwear Spark Messi. Si vous portez une autre tenue, elle jouera « Bêlement »."),("it","L'emote Fan n. 1 dei lama riprodurrà \"Messi\" solo se utilizzata quando indossi il costume Lionel Messi o Messi scintilla di streetwear, mentre riprodurrà \"Baaa\" quando indossi qualsiasi altro costume."),("ja","エモート「#1ファンラマ」は、コスチューム「Lionel Messi」または「ストリートウェア・スパーク Messi」のいずれかを使用時にのみ「Messi」と鳴き、その他のコスチュームを使用時は「メーー」と鳴きます。"),("ko","1등 팬 라마 이모트는 리오넬 메시 또는 스트리트웨어 스파크 메시 의상을 착용한 상태에서 사용할 때만 \"메시다!\"가 재생되며, 그 외의 의상을 착용한 상태에서는 \"바~\"가 재생됩니다."),("pl","Eemotka lamy-fanki #1 powie \„Messi\" tylko wtedy, gdy masz na sobie strój Lionela Messiego lub Streetwear Spark Messi, natomiast odtworzy \„Baaa\", jeśli masz na sobie inny strój."),("pt-BR","O emote Fã Llama n.º 1 reproduzirá \"Messi\" apenas quando estiver usando os trajes Lionel Messi ou Messi Craque Urbano, e reproduzirá \"Baaa\" quando usar qualquer outra roupa."),("ru","Эмоция #1 «Фанатская лама» будет говорить «Месси» только при использовании экипировки Лионеля Месси или Уличного Месси, и кричать «Беее» при ношении любой другой экипировки."),("tr","Hayran Llama İfadesi yalnızca Lionel Messi veya Sokağın Parıltısı Messi Kıyafeti giyildiğinde \"Messi\"yi oynatır ve diğer herhangi bir Kıyafet giyildiğinde ise \"Beee\"yi oynatır."),("zh-hans","仅在穿着利昂内尔·梅西或街头火花梅西服装时，头号粉丝羊驼姿势才会播放\"Messi\"音效；穿着其他服装时，改姿势则会播放\"Baaa\"音效。")))
