+TextReplacements=(Category=Game, Namespace="ReportReasonDetails", bIsMinimalPatch=True, Key="CommunicationAbuseDetails", NativeString="If you have Voice Reporting On and would like to include an audio recording with your report, you can submit a voice report via the voice chat tab in the Sidebar.", LocalizedStrings=(("ar","في حالة تنشيطك للإبلاغ الصوتي وأردت إدراج تسجيل صوتي مع بلاغك، يمكنك تقديم بلاغ صوتي عبر تبويب الدردشة الصوتية في الشريط الجانبي. في حالة تنشيطك للإبلاغ النصي وأردت إدراج نسخة من الدردشة النصية مع بلاغك، يمكنك تقديم بلاغ دردشة نصية عبر نافذة الدردشة النصية."),("en","If you have Voice Reporting On and would like to include an audio recording with your report, you can submit a voice report via the voice chat tab in the Sidebar. If you have Text Reporting On and would like to include your text chat transcripts with your report, you can submit a text chat report via the text chat window."),("de","Falls du Sprach-Chat-Melden aktiviert hast und eine Meldung zusammen mit einer Audioaufnahme einreichen möchtest, kannst du dies über den Sprach-Chat-Tab der Seitenleiste tun. Falls du Text-Chat-Melden aktiviert hast und eine Meldung zusammen mit einer Kopie des Text-Chat-Inhalts einreichen möchtest, kannst du dies über das Text-Chat-Fenster tun."),("es","Si tienes activada la función de informes de voz y quieres incluir una grabación de sonido en el informe, puedes hacerlo a través de la pestaña del chat de voz de la barra lateral. Si tienes activada la función de informes de texto y quieres incluir una transcripción en el informe, puedes hacerlo a través de la ventana del chat de texto."),("es-419","Si habilitaste la denuncia de voz y quieres incluir una grabación de audio de tu denuncia, puedes enviar una denuncia de voz a través de la pestaña Chat de voz en la barra lateral. Si habilitaste la denuncia de texto y quieres incluir las transcripciones del chat de texto en tu denuncia, puedes enviar una denuncia de chat de texto a través de la ventana de chat de texto."),("fr","Si vous avez activé le signalement vocal et si vous souhaitez ajouter un enregistrement sonore à votre signalement, vous pouvez le faire dans l'onglet Discussion vocale de la barre latérale. Si vous avez activé le signalement textuel et si vous souhaitez ajouter un extrait de la discussion textuelle à votre signalement, vous pouvez le faire via l'onglet Discussion textuelle."),("it","Se hai attivato la Segnalazione chat vocale e vuoi includere una registrazione audio, puoi inviare una segnalazione vocale usando la scheda della chat vocale nella barra laterale. Se hai attivato la Segnalazione chat di testo e vuoi inviare una segnalazione allegando la trascrizione di una chat, puoi farlo tramite la finestra della chat di testo."),("ja","音声通報をオンにしていて、通報に音声録音を含めたい場合は、サイドバーの「ボイスチャット」タブより音声通報を送信してください。テキスト通報をオンにしていて、通報にテキストチャットの記録を含めたい場合は、テキストチャットのウィンドウよりテキスト通報を送信してください。"),("ko","음성 신고 기능이 켜져 있는 상태에서 음성 녹음이 포함된 신고를 하려면 사이드바의 음성 채팅 탭에서 음성 신고를 제출하시면 됩니다. 텍스트 신고 기능이 켜져 있는 상태에서 텍스트 채팅 기록이 포함된 신고를 하려면 텍스트 채팅 창에서 텍스트 채팅 신고를 제출하시면 됩니다."),("pl","Jeśli masz włączone zgłaszanie głosowe i chcesz dołączyć do swojego zgłoszenia nagranie dźwięku, możesz dokonać zgłoszenia głosowego w zakładce czatu głosowego na pasku bocznym. Jeśli masz włączone zgłaszanie tekstowe i chcesz dołączyć do swojego zgłoszenia zapis czatu głosowego, możesz dokonać zgłoszenia tekstowego w oknie czatu głosowego."),("pt-BR","Caso esteja com o Registro de Voz Ligado e queira incluir uma gravação de áudio na denuncia, você pode enviar uma denúncia de voz pelo Bate-papo de Voz, na Barra Lateral. Caso tenha o Registro de Texto Ligado e queira incluir o texto do bate-papo na denúncia, é possível enviar a denúncia pela janela do bate-papo de texto."),("ru","Если вы включили отправку жалоб на голосовой чат и вы хотите прикрепить к жалобе аудиозапись, вы можете пожаловаться, открыв вкладку «Голосовой чат» на боковой панели. Если вы включили отправку жалоб на текстовый чат и вы хотите прикрепить к жалобе фрагменты переписки, вы можете пожаловаться в окошке текстового чата."),("tr","Sesli Sohbet Raporlama seçeneği açık olarak ayarlanmışsa ve raporuna ses kaydı eklemek istiyorsan yan menüdeki sesli sohbet sekmesi aracılığıyla bir sesli sohbet raporu gönderebilirsin. Yazılı Sohbet Raporlama seçeneği açık olarak ayarlanmışsa ve raporuna yazılı sohbet dökümünü eklemek istiyorsan yazılı sohbet penceresi aracılığıyla bir yazılı sohbet raporu gönderebilirsin."),("zh-hans","如果你启用了语音举报，并希望在举报中随附录音，可以通过侧边栏的语音聊天标签页提交语音举报。如果你启用了文字举报，并希望在举报中随附文字聊天副本，可以通过文字聊天窗口提交文字举报。")))
