+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="7EE89BDC4A2387D565D980B454F2480A", NativeString="Intro - Ask About	", LocalizedStrings=(("ar","ماذا يمكن أن تفعله ملكة مهرجان الشتاء لك؟"),("en","What can the queen of Winterfest do for you?"),("de","Was kann die Queen des Winterfests für dich tun?"),("es","¿En qué puede ayudarte hoy la reina del Festival de invierno?"),("es-419","¿Qué puede hacer la reina del Festival de invierno por ti?"),("fr","En quoi la reine de la Fête hivernale peut se rendre utile ?"),("it","Come Regina di Mezz'inverno, cosa posso fare per te?"),("ja","ウィンターフェストの女王に何か用かしら？"),("ko","겨울축제의 여왕이 뭘 도와 드릴까?"),("pl","Co Królowa Festiwalu Zimy może dla ciebie zrobić?"),("pt-BR","O que a rainha do Festival Invernal pode fazer por você?"),("ru","Чем королева Зимнего фестиваля может тебе помочь?"),("tr","Kış Festivali'nin kraliçesi sana nasıl yardımcı olabilir?"),("zh-hans","冬季节日女王能为你做点什么？")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="388662894738F89AA420199943D1DBBA", NativeString="Speech", LocalizedStrings=(("ar","لأني ملكة مهرجان الشتاء، نشر البهجة أهم عمل لدي."),("en","As the queen of Winterfest, my most important job is to spread cheer."),("de","Meine wichtigste Aufgabe als Queen des Winterfests ist es, Frohsinn zu verbreiten."),("es","Como reina del Festival de invierno, mi tarea más importante es repartir alegría."),("es-419","Como reina del Festival de invierno, mi trabajo más importante es repartir alegría."),("fr","En tant que reine de la Fête hivernale, ma mission est de répandre la joie."),("it","Portare la felicità è il mio compito più importante come Regina di Mezz'inverno."),("ja","ウィンターフェストの女王としての一番大事な仕事は、ホリデー気分を広めることよ。"),("ko","겨울축제의 여왕으로서, 내 가장 중요한 일은 즐거운 분위기를 퍼뜨리는 거야."),("pl","Moim najważniejszym zadaniem jako Królowej Festiwalu Zimy jest dzielenie się radością."),("pt-BR","Como Rainha do Festival Invernal, minha principal função é espalhar a alegria."),("ru","Главная обязанность королевы Зимнего фестиваля — дарить всем радость."),("tr","Kış Festivali'nin kraliçesi olarak en önemli işim ortamı şenlendirmek."),("zh-hans","作为冬季节日女王，我最重要的工作就是传播快乐！")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="B1F4A73A4940F166D05011BB35FF6706", NativeString="Speech", LocalizedStrings=(("ar","هذا الوقت من العام مميز. وليس بسبب الهدايا فحسب!"),("en","This time of year is special. And not just because of the presents!"),("de","Diese Zeit des Jahres ist was Besonderes. Und nicht nur wegen der Geschenke!"),("es","Esta época del año es especial. ¡Y no solo por los regalos!"),("es-419","Esta época del año es especial. ¡Y no solo por los regalos!"),("fr","Ce moment de l'année est spécial. Et pas juste grâce aux cadeaux !"),("it","Questo è un periodo speciale dell'anno. E non solo per i regali!"),("ja","1年の中でこの時期はとても特別なもの。プレゼントがもらえるからだけじゃないのよ！"),("ko","이 계절은 아주 특별해. 선물 때문만은 아냐!"),("pl","Ten czas w roku jest wyjątkowy. I to nie tylko z powodu prezentów!"),("pt-BR","Essa época do ano é especial, e não só por causa dos presentes!"),("ru","Это особое время года. И не только из-за подарков!"),("tr","Yılın bu zamanları çok özeldir. Bunun tek sebebi hediyeler değil!"),("zh-hans","这是每年最特别的时节。之所以特别，不仅仅是因为可以收礼物哦！")))
