+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="B68BD3B347FDFBA846D9FEBAC6C3F2B1", NativeString="Speech", LocalizedStrings=(("ar","إذن... هل تشعر بالبهجة؟"),("en","So... are you feeling cheerful?"),("de","Und ...? Bist du fröhlich?"),("es","Dime, ¿estás alegre?"),("es-419","Así que... ¿estás alegre?"),("fr","Alors ? Êtes-vous d'humeur joviale ?"),("it","Allora... senti la vicinanza delle festività?"),("ja","あなたは… ホリデー気分を満喫できてる？"),("ko","그래... 명랑한 기분이 드니?"),("pl","A więc... czujesz radość?"),("pt-BR","E aí... está se sentindo alegre?"),("ru","Ты радуешься?"),("tr","Peki... şen şakrak hissetmeye başladın mı?"),("zh-hans","那么……你快不快乐？")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="B30CB79941CC33C3076944872C85D451", NativeString="Speech", LocalizedStrings=(("ar","لا شيء يضاهي قضاء الوقت مع أحبائنا ونحن نتناول طعامًا شهيًا ونستمع إلى موسيقى رائعة."),("en","There's nothing like spending time with loved ones, eating good food and listening to great music."),("de","Nichts ist besser als eine schöne Zeit mit geliebten Menschen, gutes Essen und tolle Musik."),("es","No hay nada como pasar tiempo con tus seres queridos mientras comes cosas ricas y escuchas buena música."),("es-419","No hay nada como pasar tiempo con tus seres queridos, comer buena comida y escuchar música genial."),("fr","Quel plaisir d'être avec ceux qu'on aime autour d'un bon repas et avec de la bonne musique."),("it","Nulla è paragonabile al passare tempo con le persone che ami, mangiare buon cibo e ascoltare grande musica."),("ja","大切な人たちと過ごしたり、美味しいご飯を食べたり、素晴らしい音楽を聴いたりするのに勝るものはないわ。"),("ko","사랑하는 이들과 시간을 보내고, 맛있는 음식을 먹고 좋은 음악을 듣는 것보다 좋은 건 없지."),("pl","Nie ma to jak spędzać czas z ukochanymi, jeść dobre jedzenie i słuchać świetnej muzyki."),("pt-BR","Nada como passar um tempo com as pessoas que amamos, comer comida boa e ouvir excelentes músicas."),("ru","Нет ничего лучше, чем посиделки с друзьями, вкусная еда, отличная музыка..."),("tr","Sevdiklerinle vakit geçirmek, lezzetli yiyecekler yemek ve güzel müzikler dinlemek gibisi yoktur."),("zh-hans","与自己爱的人共聚一堂，享受美食，聆听美妙的音乐——没有比这更惬意的啦！")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="939C74464A2EF3F7EEB3B186B0A108D1", NativeString="Speech", LocalizedStrings=(("ar","ليس عليك الإجابة عن ذلك. أجزم أن ما يجول بخاطرك هو: صحيح أيتها الملكة ماريا!"),("en","You don't have to answer that. I can totally tell you're thinking Yes, Queen Mariah!"),("de","Du musst das nicht beantworten. Ich seh es dir deutlich an, dass du denkst: Ja, Queen Mariah!"),("es","No hace falta que digas nada. Se nota que estás pensando ¡Sí, reina Mariah!."),("es-419","No tienes que responder. Sé que estás pensando ¡Sí, reina Mariah!."),("fr","Pas la peine de répondre. Je sais très bien ce que vous pensez : Oh oui, reine Mariah !."),("it","Non serve che tu risponda. Lo vedo che stai pensando Sì, Regina Mariah!"),("ja","答えなくていいわよ。心が読めるもの。「はい、Mariah女王！」でしょ？"),("ko","대답은 안 해도 돼. 분명 '네, 머라이어 여왕 폐하!'라고 생각하고 있겠지."),("pl","Nie musisz odpowiadać. Jestem pewna, że myślisz: Tak, Królowo Mariah!."),("pt-BR","Não precisa nem responder, já sei o que você está pensando: Sim, Rainha Mariah!"),("ru","Не отвечай. Я и так знаю, что ты думаешь: Да, королева Мэрайя!"),("tr","Bunu cevaplamak zorunda değilsin. Evet Kraliçe Mariah! diye düşündüğünü kesinlikle anlayabiliyorum."),("zh-hans","你不用回答。你肯定在想，遵命，玛丽亚女王！我一看就知道。")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="34EF8D6E45E2EBA5897B329A10FA3A8C", NativeString="Speech", LocalizedStrings=(("ar","موسيقى مذهلة حقًا. موسيقى مميزة وحاصلة على عدة شهادات بلاتينية تغنيها ملكة طبقة صوتها مثالية."),("en","Amazing music, actually. Iconic, multi-platinum-certified music sung by a queen with perfect pitch."),("de","Sogar fantastische Musik. Mehrfach mit Platin ausgezeichnete Kultmusik von einer Queen mit perfekter Stimmlage."),("es","Una canción increíble. Una canción emblemática, con varios discos de platino y cantada por una reina de la afinación."),("es-419","Música increíble, en realidad. Música icónica, con varios discos de platino, cantada por una reina con una afinación perfecta."),("fr","De l'excellente musique, même. Multi-disque de platine, chantée par une reine à la voix parfaite."),("it","Musica fantastica, in effetti. Musica leggendaria, pluri-disco-di-platino, cantata da una Regina dall'intonazione perfetta."),("ja","最高の音楽よ。ホリデーシーズンと言えばこれ。マルチ・プラチナ認定された曲を絶対音感の女王が歌うのだもの。"),("ko","정말 멋진 음악인데. 절대음감을 자랑하는 여왕이 부르는 상징적이고 멀티 플래티넘 달성 노래."),("pl","A nawet niesamowitej muzyki. Kultowej, wielokrotnie pokrytej platyną muzyki, śpiewanej w idealnej tonacji przez Królową."),("pt-BR","Música incrível, na verdade. Músicas icônicas dignas de vários discos de platina e cantadas por uma rainha com entonação perfeita."),("ru","Даже не «отличная», а ИЗУМИТЕЛЬНАЯ. Не раз отмеченная платиной, в безупречном исполнении королевы..."),("tr","Hatta harika müzikler demek istedim. Bir kraliçe tarafından kusursuz şekilde söylenmiş ikonik, birçok kez platin sertifika almış müzikler dinlemek."),("zh-hans","其实这音乐很不错哦。荣膺多个白金奖项、经由大众认证、经久不衰的知名歌曲，由绝对音感女王演唱。")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="3F819FAA415DD901FC155DAD03F56C07", NativeString="Speech", LocalizedStrings=(("ar","هذا سحر العطلات!"),("en","That's just the magic of the holidays!"),("de","Das ist eben die Magie des Fests!"),("es","¡Es la magia de la Navidad!"),("es-419","¡Es la magia de las fiestas!"),("fr","C'est ça, la magie des fêtes !"),("it","È semplicemente la magia delle feste!"),("ja","それがまさにホリデーの魔法なの！"),("ko","이거야말로 크리스마스의 마법이지!"),("pl","I to jest właśnie magia świąt!"),("pt-BR","Essa é a magia das festas!"),("ru","Вот это я понимаю — праздник!"),("tr","İşte yılbaşının büyüsü bu!"),("zh-hans","这就是节日的魔力！")))
