+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="8C259A214E6494687676DD960841E403", NativeString="TBD", LocalizedStrings=(("ar","يظهر فأس نصال السرعوف نمطًا مختلفًا عند تجهيزه بزي في (يباع بشكل منفصل). للمعاينة، جهز ذلك الزي وعُد إلى هذه الصفحة"),("en","Mantis Blades Pickaxe shows different style when equipped with the V outfit (sold separately). To preview, equip that Outfit and return to this page"),("de","Die Spitzhacke Mantisklingen wird mit einem anderen Stil angezeigt, wenn sie zusammen mit dem Outfit V (separat erhältlich) ausgerüstet wird. Du erhältst eine Vorschau davon, wenn du das Outfit ausrüstest und auf diese Seite zurückkehrst."),("es","El pico Garras mantis se muestra con un estilo diferente cuando se equipa con el traje de V (se vende por separado). Para ver cómo queda, equipa el traje y vuelve a esta página."),("es-419","El pico Garras mantis tiene un estilo diferente al equiparlo con el atuendo V (se vende por separado). Para previsualizarlo, equipa el atuendo y vuelve a esta página."),("fr","La pioche Lames Mantis affiche un style différent quand elle est équipée avec la tenue V (vendue séparément). Pour le prévisualiser, équipez-vous de la tenue et revenez sur cette page."),("it","Il piccone Lame da mantide appare con uno stile diverso quando viene equipaggiato insieme al costume V (venduto a parte). Per visualizzarne un'anteprima, equipaggia quel costume e torna su questa pagina"),("ja","ツルハシ「マンティスブレード」はコスチューム「V」(別売り)に合わせると別のスタイルで表示されます。プレビューを表示するには、対象のコスチュームを装備してこちらのページを閲覧してください"),("ko","맨티스 블레이드 곡괭이는 V 의상(별도 판매)과 함께 장착 시 스타일이 달라집니다. 미리 보려면 해당 의상을 장착하고 이 페이지로 돌아오세요."),("pl","Kilof Ostrza Modliszkowe, używany ze strojem V (sprzedawanym osobno), ma inny styl. Aby go zobaczyć, wyposaż ten strój i wróć na tę stronę"),("pt-BR","A Picareta Lâminas Louva-a-Deus exibe um estilo diferente quando equipada com o Traje V (vendido separadamente). Para pré-visualizar o estilo, equipe o Traje e retorne a esta página"),("ru","«Клинки богомола» отображаются в другом стиле, если используются одновременно с экипировкой Ви (продаётся отдельно). Для предварительного просмотра выберите экипировку и вернитесь на эту страницу."),("tr","Z Bıçakları kazması V kıyafetiyle (ayrı satılır) birlikte kuşanıldığında farklı bir tarza bürünür. Önizlemek için o kıyafeti kuşandıktan sonra bu sayfaya geri dön."),("zh-hans","装备V皮肤（单独出售）时，螳螂刀刃镐会显示不同的风格。装备皮肤并返回本页进行预览")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="3FC1E47447986F808BB6118BA031EFAA", NativeString="Includes customizable decals and wheels! Decals in this bundle are restricted to the Lamborghini Urus SE car body. This Car will fill the Sports Car slot in relevant Fortnite experiences.", LocalizedStrings=(("ar","تشمل ملصقات وعجلات قابلة للتخصيص! ملصقات هذه الحزمة مقتصرة على هيكل سيارة Lamborghini Urus SE. ستملأ هذه السيارة خانة سيارة الدفع الرباعي في تجارب Fortnite ذات الصلة."),("en","Includes customizable decals and wheels! Decals in this bundle are restricted to the Lamborghini Urus SE car body. This Car will fill the SUV slot in relevant Fortnite experiences."),("de","Enthält anpassbare Aufkleber und Räder! Die Aufkleber in diesem Paket sind auf die Karosserie „Lamborghini Urus SE“ beschränkt. Dieses Auto belegt in relevanten Fortnite-Erlebnissen den SUV-Slot."),("es","¡Incluye calcomanías y ruedas personalizables! Las calcomanías de este lote solo están disponibles para la carrocería del Lamborghini Urus SE. Este vehículo ocupará el espacio del SUV en las experiencias de Fortnite pertinentes."),("es-419","¡Incluye calcomanías personalizables y ruedas! Las calcomanías de este lote solo están disponibles para la carrocería Lamborghini Urus SE. Este auto llenará el espacio de TrailSmasher en las experiencias de Fortnite pertinentes."),("fr","Comprend des stickers et des roues personnalisables ! Les stickers de ce pack ne fonctionnent que sur le châssis Lamborghini Urus SE. Ce véhicule sera placé dans l'emplacement SUV des expériences de Fortnite concernées."),("it","Include adesivi personalizzabili e ruote! Gli adesivi di questo bundle sono limitati alla carrozzeria Lamborghini Urus SE. Questa auto occuperà lo slot SUV nelle esperienze di Fortnite del caso."),("ja","カスタマイズ可能なデカールとホイールが付属！ このバンドル内のデカールは、マシンのボディ「Lamborghini Urus SE」に限定されています。このマシンは、対応しているフォートナイトの体験においてSUVとして使用できます。"),("ko","커스터마이징 가능한 데칼 및 바퀴 포함! 이 번들의 데칼은 Lamborghini Urus SE 차체에만 사용할 수 있습니다. 이 차량은 관련 포트나이트 경험에서 SUV 슬롯에 할당됩니다."),("pl","Zawiera konfigurowalne wzory i koła! Elementy tego zestawu można wykorzystać tylko w połączeniu z karoserią Lamborghini Urus SE. Ten samochód znajdzie się w polu SUV-a we wszystkich odpowiednich przygodach Fortnite."),("pt-BR","Inclui Adesivos e rodas personalizáveis! Os adesivos deste pacote são restritos ao Chassi Lamborghini Urus SE. Este Carro preencherá o espaço de SUV nas experiências Fortnite relevantes."),("ru","Включает настраиваемые декали и колёса! Декали из этого комплекта совместимы только с кузовом Lamborghini Urus SE. Эта машина будет занимать ячейку внедорожника в соответствующих режимах Fortnite."),("tr","Özelleştirilebilir çıkartmalar ve tekerlekler içerir! Bu paketteki çıkartmaları yalnızca Lamborghini Urus SE araba gövdesiyle kullanabilirsin. Bu araba uygun Fortnite deneyimlerinde SUV yuvasını doldurur."),("zh-hans","包括可自定义的涂装和车轮！此同捆包中的涂装仅可用于Lamborghini Urus SE车体。本车辆在 Fortnite 相关活动中会填充SUV栏位。")))
