+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="C1623141433615BD63252E976917B687", NativeString="Decals in this bundle are restricted to the Komodo car body. This car will fill the Sports Car slot in relevant Fortnite experiences.", LocalizedStrings=(("ar","تتضمن سيارة وبدائل للسيارة وملصقات قابلة للتخصيص! ملصقات هذه الحزمة مقتصرة على هيكل سيارة كومودو. ستملأ هذه السيارة خانة السيارة الرياضية في تجارب Fortnite ذات الصلة."),("en","Includes car, car variants, and customizable decals! Decals in this bundle are restricted to the Komodo car body. This car will fill the sportscar slot in relevant Fortnite experiences."),("de","Enthält ein Auto, Autovarianten und anpassbare Aufkleber! Die Aufkleber in diesem Paket sind auf die Karosserie „Komodo“ beschränkt. Dieses Auto belegt in relevanten Fortnite-Erlebnissen den Sportwagen-Slot."),("es","Incluye coche, variantes de coche y calcomanías personalizables. Las calcomanías de este lote solo están disponibles para la carrocería del Komodo. Este vehículo ocupará el espacio del coche deportivo en las experiencias de Fortnite pertinentes."),("es-419","¡Incluye un auto, variantes de auto y calcomanías personalizables! Las calcomanías de este lote solo están disponibles para la carrocería Komodo. Este auto llenará el espacio de auto deportivo en las experiencias de Fortnite pertinentes."),("fr","Comprend un véhicule et des stickers personnalisables ! Les stickers de ce pack ne fonctionnent que sur le châssis Komodo. Cette voiture sera placée dans l'emplacement Voiture de sport des expériences de Fortnite concernées."),("it","Include l'auto, le varianti e gli adesivi personalizzabili! Gli adesivi di questo bundle sono limitati alla carrozzeria Komodo. Questa auto occuperà lo slot Auto sportiva nelle esperienze di Fortnite del caso."),("ja","マシン、マシンのバリエーション、カスタマイズ可能なデカールを収録！ このバンドル内のデカールは、マシンのボディ「Komodo」に限定されています。このマシンは、対応しているフォートナイトの体験においてスポーツカーとして使用できます。"),("ko","차량, 차량 추가 스타일, 커스터마이징 가능 데칼 포함! 이 번들의 데칼은 Komodo 차체에만 사용할 수 있습니다. 이 차량은 관련 포트나이트 경험에서 스포츠카 슬롯에 할당됩니다."),("pl","Zawiera samochód, warianty samochodu i konfigurowalne wzory! Wzory z tego zestawu można wykorzystać tylko w połączeniu z karoserią Komodo. Ten samochód znajdzie się w polu samochodu sportowego we wszystkich odpowiednich przygodach Fortnite."),("pt-BR","Inclui carro, variantes do carro e Adesivos personalizados! Os Adesivos deste pacote são restritos ao Chassi Komodo. Este carro preencherá o espaço de Carro Esportivo nas experiências Fortnite relevantes."),("ru","Включает машину, варианты внешнего вида машины и настраиваемые декали! Декали из этого комплекта совместимы только с кузовом Komodo. Эта машина будет занимать ячейку спортивных автомобилей в соответствующих режимах Fortnite."),("tr","Araba, araba çeşitleri ve özelleştirilebilir çıkartmalar içerir! Bu paketteki çıkartmaları yalnızca Komodo araba gövdesiyle kullanabilirsin. Bu araba uygun Fortnite deneyimlerinde spor araba yuvasını doldurur."),("zh-hans","包括车辆、变体车型以及可自定义的涂装！该同捆包中的涂装仅可用于Komodo车体。在Fortnite相关活动中，此车辆会填充运动跑车栏位。")))
