+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="F83EF02D45861D1496630982891ED054", NativeString="Karasu & Corva Bundle", LocalizedStrings=(("ar","حزمة كاراسو وكورفيدا"),("en","Karasu & Corvida Bundle"),("de","„Karasu & Corvida“-Paket"),("es","Lote de Karasu y Córvida"),("es-419","Lote Karasu y Córvida"),("fr","Pack Karasu et Corvida"),("it","Bundle Karasu e Corvida"),("ja","カラス&コルヴィダ バンドル"),("ko","카라스와 코르바 번들"),("pl","Zestaw Karasu i Corvida"),("pt-BR","Pacotão Karasu e Corvida"),("ru","Комплект «Карасу и Корвида»"),("tr","Karasu ve Kargül Paketi"),("zh-hans","卡拉司和鸦雀同捆包")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="18AFF9DD4DE97349CE2C97999041162B", NativeString="TBC", LocalizedStrings=(("ar","تتضمن ملصقات قابلة للتخصيص عناصر هذه الحزمة مقتصرة على هيكل سيارة Fast & Furious Nissan Skyline. ستملأ هذه السيارة خانة السيارة الرياضية في تجارب Fortnite ذات الصلة."),("en","Includes customizable decals! Decals in this bundle are restricted to the Fast & Furious Nissan Skyline car body. This car will fill the Sportscar slot in relevant Fortnite experiences."),("de","Enthält anpassbare Aufkleber! Die Aufkleber in diesem Paket sind auf die Karosserie „Fast & Furious Nissan Skyline“ beschränkt. Dieses Auto belegt in relevanten Fortnite-Erlebnissen den Sportwagen-Slot."),("es","Incluye calcomanías personalizables. Las calcomanías de este lote solo están disponibles para la carrocería del Fast & Furious Nissan Skyline. Este vehículo ocupará el espacio del coche deportivo en las experiencias de Fortnite pertinentes."),("es-419","¡Incluye calcomanías personalizables! Los objetos de este lote solo están disponibles para la carrocería Nissan Skyline de Fast & Furious. Este auto llenará el espacio de auto deportivo en las experiencias de Fortnite pertinentes."),("fr","Comprend des stickers personnalisables ! Les objets de ce pack ne fonctionnent que sur le châssis Fast & Furious Nissan Skyline. Cette voiture sera placée dans l'emplacement Voiture de sport des expériences de Fortnite concernées."),("it","Include gli adesivi personalizzabili! Gli adesivi di questo bundle sono limitati alla carrozzeria Fast & Furious Nissan Skyline. Questa auto occuperà lo slot Auto sportiva nelle esperienze di Fortnite del caso."),("ja","カスタマイズ可能なデカールが付属！ このバンドル内のデカールは、マシンのボディ「Fast & Furious Nissan Skyline」に限定されています。このマシンは、対応しているフォートナイトの体験においてスポーツカーとして使用できます。"),("ko","커스터마이징 가능한 데칼 포함! 이 번들의 아이템은 Fast & Furious Nissan Skyline 차체에만 사용할 수 있습니다. 이 차량은 관련 포트나이트 경험에서 스포츠카 슬롯에 할당됩니다."),("pl","Zawiera konfigurowalne wzory! Elementy tego zestawu można wykorzystać tylko z karoserią Fast & Furious Nissan Skyline. Ten samochód znajdzie się w polu samochodu sportowego we wszystkich odpowiednich przygodach Fortnite."),("pt-BR","Inclui Adesivos personalizados! Os Adesivos deste pacote são restritos ao Chassi Fast & Furious Nissan Skyline. Este carro preencherá o espaço de Carro Esportivo nas experiências Fortnite relevantes."),("ru","Включает настраиваемые декали! Предметы из этого комплекта совместимы только с кузовом Fast & Furious Nissan Skyline. Эта машина будет занимать ячейку спортивного автомобиля в соответствующих режимах Fortnite."),("tr","Özelleştirilebilir çıkartmalar içerir! Bu paketteki çıkartmaları yalnızca Fast & Furious Nissan Skyline araba gövdesiyle kullanabilirsin. Bu araba uygun Fortnite deneyimlerinde spor araba yuvasını doldurur."),("zh-hans","包括可定制的涂装！此同捆包中的物品仅可用于Fast & Furious Nissan Skyline车体。在Fortnite相关活动中，此车辆会填充运动跑车栏位。")))
